import { NavLink } from "react-router-dom";

export default function Navbar() {
  return (
    <nav className="navbar">
      <h1>Apartments</h1>
      <div className="links">
        <NavLink to="/" end>
          Home
        </NavLink>
        <NavLink to="/bookmarks">Bookmarks</NavLink>
      </div>
    </nav>
  );
}
